import React from "react";
import ProjectItem from "../components/ProjectItem";
import { ProjectList } from "../helpers/ProjectList";
import profilePicture from "../assets//propic2.jpg";
import GithubIcon from "@material-ui/icons/GitHub";

import "../styles/Projects.css";

function Projects() {
  return (
    <div>
      <div className="projects">
        <h1 class="p1"> My Personal Projects</h1>
        <div className="projectList">
          {ProjectList.map((project, idx) => (
            <ProjectItem key={idx} name={project.name} image={project.image} />
          ))}
        </div>
      </div>

      <div className="area">
        <div>
          <p className="p"> To See More Pojects check out my GitHub !</p>
          <img src={profilePicture} alt="Profile" className="profile-image" />
          <a className="github-link" href="https://github.com/ibrahimkedir10" target="_blank" rel="noopener noreferrer">
            <GithubIcon className="github-icon" />
          </a>
        </div>
        <ul className="circles">
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
        </ul>
      </div>
    </div>
  );
}

export default Projects;
